from dataclasses import dataclass, field
from typing import Dict, List, Optional

@dataclass
class Section:
    name: str
    keywords: List[str]
    description: str
    embedding: List[List[float]]
    label: str
    threshold: float

@dataclass
class SectionConfig:
    sections: List[Section] = field(default_factory=list)

    def get_config_names(self) -> List[str]:
        return [section.name for section in self.sections]
    
    def get_config(self, name: str) -> Optional[dict]:
        for section in self.sections:
            if section.name == name:
                return {"keywords": section.keywords, "description": section.description, "embedding": section.embedding, "label": section.label, "threshold": section.threshold}
        return None
    
    def get_all_configs(self) -> List[Dict[str, str]]:
        return [{"name": section.name, "description": section.description} for section in self.sections]

